  [],\n\t\"revision_timestamp\": \"2014-10-28T20:00:30.425404\",\n\t\"name\": \"terrestrial-ecosystems-land-surface-forms-of-the-conterminous-united-states\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The U.S. Geological Survey (USGS) has generated
  land surface form classes for the contiguous United States. These land surface form
  classes were created as part of an effort to map standardized, terrestrial ecosystems
  for the nation using a classification developed by NatureServe (Comer and others,
  2003). Ecosystem distributions were modeled using a biophysical stratification approach
  developed for South America (Sayre and others, 2008) and now being implemented globally
  (Sayre and others, 2007). Land surface forms strongly influence the differentiation
  and distribution of terrestrial ecosystems, and are one of the key input layers
  in the ecosystem delineation process. The methodology used to produce these land
  surface form classes was developed by the Missouri Resource Assessment Partnership
  (MoRAP). MoRAP made modifications to Hammond's (1964a, 1964b) land surface form
  classification, which allowed the use of 30-meter source data and a 1 km2 window
  for neighborhood analysis (True 2002, True and others, 2000). While Hammond's methodology
  was based on three variables, slope, local relief, and profile type, MoRAP's methodology
  uses only slope and local relief (True 2002). Slope is classified as gently sloping
  or not gently sloping using a slope threshold of 8%, local relief is classified
  into five classes (0-15m, 15-30m, 30-90m, 90-150m, and >150m), and eight landform
  classes (flat plains, smooth plains, irregular plains, escarpments, low hills, hills,
  breaks, and low mountains) were derived by combining slope class and local relief.
  The USGS implementation of the MoRAP methodology was executed using the USGS 30-meter
  National Elevation Dataset (NED) and an existing USGS slope dataset. In this implementation,
  a new land surface form class, the high mountains/deep canyons class, was identified
  by using an additional local relief class (> 400m). The drainage channels class
  was derived independently from the other land surface form classes. This class was
  derived using two of Andrew Weiss's slope position classes, \"valley\" and \"lower
  slope\" (Weiss 2001, Jenness 2006). The USGS implemented Weiss's algorithm using
  the 30-meter NED and a 1 km2 neighborhood analysis window. The resultant drainage
  channel class was combined into the final land surface forms dataset.\",\n\t\"license_title\":
